import React from 'react';
import { ListGroup, ListGroupItem } from 'reactstrap';

const Menus=()=>{
    return(
        <ListGroup>
            <ListGroupItem tag="a" href="#!">Home</ListGroupItem>
            <ListGroupItem tag="a" href="#!">Register Admin</ListGroupItem>
            <ListGroupItem tag="a" href="#!">Register Customer</ListGroupItem>
            <ListGroupItem tag="a" href="#!">Register Worker</ListGroupItem>
            <ListGroupItem tag="a" href="#!">View Admins</ListGroupItem>
            <ListGroupItem tag="a" href="#!">View Customers</ListGroupItem>
            <ListGroupItem tag="a" href="#!">View Workers</ListGroupItem>
        </ListGroup>
    )
}

export default Menus;
